var anticaptcha = require('./anticaptcha')('97ba849834f8d9a155e64ee177d2588e');

//recaptcha key from target website
anticaptcha.setWebsiteURL("https://stackoverflow.com/questions/61324858/python-convert-captcha-image-to-text");
anticaptcha.setWebsiteKey("");

anticaptcha.createTaskImageToText(function (err, taskId) {
        if (err) {
            console.error(err);
            return;
        }

        console.log('Got task ID', taskId);

        //wait for solution and print to console
        anticaptcha.getTaskSolution(taskId, function (err, taskSolution) {
            if (err) {
                console.error(err);
                return;
            }

            console.log(taskSolution);
        });
    }
);












